        <textarea
          className="form__input"
          type="text"
          placeholder="Описание"
          name="description"
          id="description"
          fi
          //onChange={onChangePassword}
          required
        />
      </fieldset>
      <button type="submit" className="form__submit">
        Добавить
      </button>
    </form>
  );
}
